const QRDecoderMain = (props) => {
  const iframeContainerStyle = {
    width: '100%',
    height: 'calc(100% - 56px)',
    top: '56px'
  }

  const iframeStyle = {
    width: '100%',
    height: '100%',
  }

  return <div style={iframeContainerStyle} {...props}>
    <iframe style={iframeStyle} sandbox='allow-scripts' src='https://mudev.cc/qrdecode' style={iframeStyle} />
  </div>;
}

export { QRDecoderMain };
